import React from 'react';
import { jsPDF } from 'jspdf';
import {QRCodeCanvas}    from 'qrcode.react';
import './CertificateDetail.css';


const CertificateDetails = ({ certificate }) => {

    const generateCertificatePDF = () => {
        const doc = new jsPDF();

        // Set the background color
        doc.setFillColor(255, 255, 255); // White background
        doc.rect(0, 0, doc.internal.pageSize.getWidth(), doc.internal.pageSize.getHeight(), 'F');

        // Add a border
        doc.setDrawColor(0, 51, 102); // Dark blue
        doc.setLineWidth(5);
        doc.rect(10, 10, doc.internal.pageSize.getWidth() - 20, doc.internal.pageSize.getHeight() - 20); // Border

        // Title
        doc.setFont('Times', 'bold'); // Elegant font for title
        doc.setTextColor(0, 51, 102); // Dark blue
        doc.setFontSize(30);
        doc.text('Certificate of Achievement', doc.internal.pageSize.getWidth() / 2, 40, { align: 'center' });

        // Subtitle
        doc.setFont('Times', 'normal');
        doc.setFontSize(18);
        doc.text('This certifies that', doc.internal.pageSize.getWidth() / 2, 70, { align: 'center' });

        // Recipient's name
        doc.setFontSize(26);
        doc.setFont('Times', 'bold');
        doc.text(certificate.name, doc.internal.pageSize.getWidth() / 2, 100, { align: 'center' });

        // Course completion statement
        doc.setFont('Times', 'normal');
        doc.setFontSize(18);
        doc.text('has successfully completed the course:', doc.internal.pageSize.getWidth() / 2, 130, { align: 'center' });

        // Course name
        doc.setFont('Times', 'bold');
        doc.setFontSize(24);
        doc.setTextColor(0, 102, 204); // Lighter blue for course name
        doc.text(certificate.course, doc.internal.pageSize.getWidth() / 2, 160, { align: 'center' });

        // Issued date and status
        doc.setFont('Times', 'normal');
        doc.setFontSize(16);
        doc.setTextColor(0, 0, 0); // Black
        doc.text(`Issued on: ${new Date(certificate.issueDate).toLocaleDateString()}`, doc.internal.pageSize.getWidth() / 2, 190, { align: 'center' });
        doc.text(`Status: ${certificate.status}`, doc.internal.pageSize.getWidth() / 2, 210, { align: 'center' });

        // Add a decorative flourish or line
        doc.setDrawColor(0, 51, 102); // Dark blue
        doc.setLineWidth(1);
        doc.line(20, 230, 190, 230); // Decorative line

        // Use base64 image data to avoid async loading issue
        const signatureBase64 = ''; // Replace with your base64 image string

        // Add signature image from base64
        doc.addImage(signatureBase64, 'PNG', doc.internal.pageSize.getWidth() / 2 - 25, 240, 50, 20); // Adjust width, height, and position

        // Signature placeholder text below the image
        doc.setFont('Times', 'normal');
        doc.setFontSize(12);
        doc.text('Authorized Signature', doc.internal.pageSize.getWidth() / 2, 270, { align: 'center' });

         // Generate QR code URL
         const verificationUrl = `${window.location.origin}/verify/${certificate.certificateID}`;

         // Add the QR code to the PDF
         const qrCodeImage = document.getElementById('qrCode');
         doc.addImage(qrCodeImage.toDataURL(), 'PNG', doc.internal.pageSize.getWidth() / 2 - 20, 240, 40, 40);

        // Save the document
        doc.save(`certificate_${certificate.certificateID}.pdf`);
    };

    return (
        
        <div className="certificate-details">
            <h3>Certificate Details</h3>
            <p><strong>Name:</strong> {certificate.name}</p>
            <p><strong>Course:</strong> {certificate.course}</p>
            <p><strong>Issued On:</strong> {new Date(certificate.issueDate).toLocaleDateString()}</p>
            <p><strong>Status:</strong> {certificate.status}</p>

            <QRCodeCanvas
                id="qrCode"
                value={`${window.location.origin}/verify/${certificate.certificateID}`}
                size={128}
                level="H"
                includeMargin={true}
            />

            <button class="download-button" onClick={generateCertificatePDF}>
                <div class="docs">
                    <svg
                        viewBox="0 0 24 24"
                        width="20"
                        height="20"
                        stroke="currentColor"
                        stroke-width="2"
                        fill="none"
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        class="css-i6dzq1"
                    >
                        <path
                            d="M14 2H6a2 2 0 0 0-2 2v16a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V8z"
                        ></path>
                        <polyline points="14 2 14 8 20 8"></polyline>
                        <line x1="16" y1="13" x2="8" y2="13"></line>
                        <line x1="16" y1="17" x2="8" y2="17"></line>
                        <polyline points="10 9 9 9 8 9"></polyline>
                    </svg>
                    Download
                </div>
                <div class="download">
                    <svg
                        viewBox="0 0 24 24"
                        width="24"
                        height="24"
                        stroke="currentColor"
                        stroke-width="2"
                        fill="none"
                        stroke-linecap="round"
                        stroke-linejoin="round"
                        class="css-i6dzq1"
                    >
                        <path d="M21 15v4a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2v-4"></path>
                        <polyline points="7 10 12 15 17 10"></polyline>
                        <line x1="12" y1="15" x2="12" y2="3"></line>
                    </svg>
                </div>
            </button>

        </div>
        
    );
};

export default CertificateDetails;
